package javaBasicPractice;

public class SwapTwoIntegers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x, y,z;
		x=10;
		y=20;
		z=x;
		x=y;
		y=z;
		
			System.out.println("swapped value of x "+x);
			System.out.println("swapped value of y "+y);
	}

}
